import styled from "styled-components";

const Header = (props) => {
    return (
        <Container>
            <Content>Header</Content>
        </Container>
    );
};

const Container = styled.div`
    background-color: white;
    border-bottom: 1px solid rgba(0, 0, 0, 0.08);
    left: 0;
    padding: 0 24px;
    //position: fixed;
    top: 0;
    width: 100vw;
    z-index: 100;
    //align-items:center;
`;

const Content = styled.div`
    display: flex;
    align-items: center;
    margin: 0 auto;
    min-height: 100%;
    //max-width: 1128px;
`;

export default Header;
